import React from 'react'
import Router from 'next/router'


class About extends React.Component {
    render() {
        return (
            <div>
                <div>Welcome to About Page</div>
                <button onClick={() => Router.push('/')}>Click me</button>
            </div>
            
        )
    }
}


export default About
